def minEatingSpeed(piles, h):
    if h == len(piles): return max(piles)
    # works but time limit exceeded O(n)
    cur_k = 1
    while True:
        h_ = 0

        for i in piles:
            h_ += i // cur_k + (i % cur_k != 0)

        if h_ == h:
            return cur_k

        cur_k += 1

#print(minEatingSpeed([30,11,23,4,20], 5)) # 30
#print(minEatingSpeed([30,11,23,4,20], 6)) # 23
#print(minEatingSpeed([3,6,7,11], 8))      # 4

def search(piles, h, l, r):
    while l <= r:
        m = l + (r - l) // 2
        h_ = sum([i // m + (i % m != 0) for i in piles])

        if h_ == h: return m
        elif h_ < h: r = m - 1
        else: l = m + 1
    return l

def minEatingSpeed1(piles, h):
    if len(piles) == 1: return piles[0]//h+1 if piles[0] % h != 0 else piles[0]//h
    if h == len(piles): return max(piles)

    l, r_old = 1, max(piles)-1
    r_new = search(piles, h, l, r_old)
    while r_new < r_old:
        r_old = r_new
        r_new = search(piles, h, l, r_old)

    return r_new

